import React from 'react';
import img from "../../assets/img/home.jpeg";

export default function Main() {
  return (
    <div className="bg-white min-w-screen">
      <div className="flex w-100">
        <div className="w-3/12 bg-black">Hello world</div>
        <div className="w-9/12 min-h-[80vh]">
            <img src={img} className='w-100 h-100' alt="" />
        </div>
      </div>
    </div>
  );
}
